import React from 'react';

const Home = () => {
  return (
    <>
      {/*Main Navigation*/}
      <header>
        {/* Sidenav */}
        <div id="sidenav-1" className="sidenav" data-mdb-color="dark" role="navigation" data-mdb-hidden="false"
          data-mdb-accordion="true">
          <a className="ripple d-flex justify-content-center py-3" href="#!" data-mdb-ripple-color="primary">
            <img id="MDB-logo" src="https://mdbootstrap.com/wp-content/uploads/2018/06/logo-mdb-jquery-small.png"
              alt="MDB Logo" draggable="false" height="25" />
          </a>
          <ul className="sidenav-menu">
            <li className="sidenav-item">
              <a className="sidenav-link active">
                <i className="fas fa-home fa-fw me-3"></i><span>Home</span>
              </a>
            </li>
            {/* Other list items */}
          </ul>
          <hr />
          {/* Other sidebar content */}
        </div>
        {/* Sidenav */}

        {/* Navbar */}
        <nav id="main-navbar" className="navbar navbar-expand-lg navbar-light bg-white fixed-top">
          {/* Container wrapper */}
          <div className="container-fluid">
            {/* Toggler */}
            <button data-mdb-toggle="sidenav" data-mdb-target="#sidenav-1"
              className="btn shadow-0 p-0 me-3 d-block d-xxl-none" aria-controls="#sidenav-1" aria-haspopup="true">
              <i className="fas fa-bars fa-lg"></i>
            </button>

            {/* Search form */}
            <form className="d-none d-md-flex justify-content-center mx-auto input-group w-auto my-auto">
              <input autoComplete="off" type="search" className="form-control rounded" placeholder='Search'
                style={{ minWidth: "225px" }} />
              <span className="input-group-text border-0"><i className="fas fa-search"></i></span>
            </form>

            {/* Right links */}
            <ul className="navbar-nav d-flex align-items-center flex-row">
              <li className="nav-item">
                <a className="nav-link me-3 py-1" href="#" data-mdb-toggle="tooltip" title="Create">
                  <i className="fas fa-video"></i>
                </a>
              </li>
              {/* Other nav items */}
            </ul>
          </div>
          {/* Container wrapper */}
        </nav>
        {/* Navbar */}
      </header>
      {/*Main Navigation*/}
    </>
  );
}

export default Home;
